def is_member(i, n):  # Returns True if i/n is in the Cantor set
  visited = set()
  while True:
    if n < 3 * i < 2 * n: return False
    if i in visited: return True
    visited.add(i)
    i = 3 * min(i, n - i)
def a(n): return sum(is_member(i, n) for i in range(n + 1))

